import * as React from 'react';
import { request, setAuthHeader } from '../helpers/axios_helper';
import AuthContent from './AuthContent';
import WelcomeContent from './WelcomeContent';
import LoginPage from './LoginPage'; 

export default class AppContent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      componentToShow: 'welcome', 
      loading: false,
      active: 'login' // Add active state to track the current tab (login or register)
    };
  }

  login = () => {
    this.setState({ componentToShow: 'login' });
  };

  onRoleSelect = (role) => {
    if (role === 'admin') {
      this.setState({ componentToShow: 'login' }); 
    }
  };

  onLogin = (e, username, password) => {
    e.preventDefault();
    this.setState({ loading: true });
    request('POST', '/login', {
      login: username,
      password: password,
    })
      .then((response) => {
        setAuthHeader(response.data.token);
        this.setState({ componentToShow: 'auth', loading: false }); // Change to 'auth'
      })
      .catch(() => {
        setAuthHeader(null);
        this.setState({ componentToShow: 'welcome', loading: false });
      });
  };

  onRegister = (event, firstName, lastName, username, password) => {
    event.preventDefault();
    this.setState({ loading: true });
    request('POST', '/register', {
      firstName: firstName,
      lastName: lastName,
      login: username,
      password: password,
    })
      .then((response) => {
        setAuthHeader(response.data.token);
        this.setState({ componentToShow: 'auth', loading: false }); // Change to 'auth'
      })
      .catch(() => {
        setAuthHeader(null);
        this.setState({ componentToShow: 'welcome', loading: false });
      });
  };

  render() {
    const { componentToShow, active } = this.state;

    return (
      <>
        {componentToShow === 'welcome' && <WelcomeContent onRoleSelect={this.onRoleSelect} />}
        {componentToShow === 'login' && (
          <LoginPage onLogin={this.onLogin} onRegister={this.onRegister} onBack={() => this.setState({ componentToShow: 'welcome' })} />
        )}
        {componentToShow === 'auth' && ( // Render AuthContent and Registration option
          <>
            <AuthContent />
            <ul className="nav nav-pills nav-justified mb-3" id="ex1" role="tablist">
              <li className="nav-item" role="presentation">
                <button className={classNames("nav-link", active === "login" ? "active" : "")} 
                        onClick={() => this.setState({ active: "login" })}>Login</button>
              </li>
              <li className="nav-item" role="presentation">
                <button className={classNames("nav-link", active === "register" ? "active" : "")} 
                        onClick={() => this.setState({ active: "register" })}>Register</button>
              </li>
            </ul>
            {active === 'login' && <LoginPage onLogin={this.onLogin} onRegister={this.onRegister} />}
            {active === 'register' && (
              <div className={classNames("tab-pane", "fade", active === "register" ? "show active" : "")} id="pills-register" >
                <form onSubmit={this.onSubmitRegister}>
                  <div className="form-outline mb-4">
                    <input type="text" id="firstName" name="firstName" className="form-control" onChange={this.onChangeHandler}/>
                    <label className="form-label" htmlFor="firstName">First name</label>
                  </div>
                  <div className="form-outline mb-4">
                    <input type="text" id="lastName" name="lastName" className="form-control" onChange={this.onChangeHandler}/>
                    <label className="form-label" htmlFor="lastName">Last name</label>
                  </div>
                  <div className="form-outline mb-4">
                    <input type="text" id="login" name="login" className="form-control" onChange={this.onChangeHandler}/>
                    <label className="form-label" htmlFor="login">Username</label>
                  </div>
                  <div className="form-outline mb-4">
                    <input type="password" id="registerPassword" name="password" className="form-control" onChange={this.onChangeHandler}/>
                    <label className="form-label" htmlFor="registerPassword">Password</label>
                  </div>
                  <button type="submit" className="btn btn-primary btn-block mb-3">Sign up</button>
                </form>
              </div>
            )}
          </>
        )}
      </>
    );
  }
}
